function uploadFiles(n){for(var u=document.getElementById(n),t=u.files,r=new FormData,i=0;i!=t.length;i++)r.append("files",t[i]);t.length>0?$.ajax({type:"POST",url:"/Patterns/AddPattern?handler=Upload",beforeSend:function(n){n.setRequestHeader("XSRF-TOKEN",$('input:hidden[name="__RequestVerificationToken"]').val())},data:r,processData:!1,contentType:!1,success:function(){alert(t.length+" Image(s) Uploaded!")}}):alert("Please select image(s)")}for(var coll=document.getElementsByClassName("collapsible"),i=0;i<coll.length;i++)coll[i].addEventListener("click",function(){this.classList.toggle("active");var n=this.nextElementSibling;n.style.display=n.style.display==="block"?"none":"block"});